\":26}'),(47,'966d8d33-6c56-4f89-af7e-ed6737670591',1,'Create','App\\Models\\Article',3,'App\\Models\\Article',3,'App\\Models\\Article',3,'','finished','','2022-05-31 11:50:45','2022-05-31 11:50:45',NULL,'{\"title\":\"POJ Siapkan Personil Security Terbaik Untuk Keamanan PT Sasa Inti Minahasa Selatan\",\"content\":\"<div>PT Pesonna Optima Jasa (POJ) telah dikenal sebagai salah satu perusahaan penyedia jasa keamanan terbaik dengan lebih dari 11 ribu personil security yang tersebar di seluruh Indonesia. Didukung dengan sistem keamanan SCC (Security Command Center), POJ terus berusaha memberi kontribusi nyata mendukung terwujudnya kebutuhan keamanan bagi para kliennya. Seperti yang diketahui, bahwa keamanan adalah salah satu faktor penting yang harus dipenuhi untuk mendukung lancarnya operasional suatu perusahaan. Seperti keamanan di lingkungan tempat produksi atau pabrik, bisa mendukung proses produksi yang maksimal agar kualitas produk tetap terjaga bahkan bisa terus meningkat.<br><br>PT Sasa Inti dengan brandnya yang dikenal dengan nama \\u201cSasa\\u201d yang bergerak di produksi berbagai macam bahan masakan seperti santan, saus sambal, kaldu, vetsin dan masih banyak yang lainnya, belum lama ini melakukan kesepakatan kerjasama dengan POJ untuk mempercayakan pengamanan salah satu pabrik besarnya yang terletak di Minahasa Selatan, Sulawesi Utara kepada POJ.<br><br>POJ dipercaya PT Sasa Inti untuk mengamankan pabrik yang menjadi pusat produksi santan Sasa yang berlokasi di Kabupaten Minahasa Selatan, Sulawesi Utara dengan luas 82.274 m2 dan jumlah tenaga kerja didalamnya 800 orang. POJ mengerahkan 33 personil security terbaik yang sudah terseleksi dan terlatih, untuk mengamankan pabrik santan PT Sasa Inti di Kabupaten Minahasa Selatan. 33 Personil tersebut terdiri dari 1 Chief, 4 Komandan Regu (Danru) dan 28 Anggota. Secara khusus, kerjasama ini bertujuan untuk menjaga keamanan dan ketertiban antrian kelapa yang akan dijual ke PT Sasa Inti.<\\/div><div><br><\\/div>\",\