4,'App\\Models\\Article',4,'App\\Models\\Article',4,'','finished','','2022-05-31 11:54:01','2022-05-31 11:54:01',NULL,'{\"title\":\"Bank NTB Syariah Percayakan POJ Untuk Sediakan Mobil Operasional\",\"content\":\"<div>PT Pesonna Optima Jasa (POJ) telah dikenal sebagai salah satu perusahaan penyedia jasa keamanan terbaik dengan lebih dari 11 ribu personil security yang tersebar di seluruh Indonesia. Didukung dengan sistem keamanan SCC (Security Command Center), POJ terus berusaha memberi kontribusi nyata mendukung terwujudnya kebutuhan keamanan bagi para kliennya. Seperti yang diketahui, bahwa keamanan adalah salah satu faktor penting yang harus dipenuhi untuk mendukung lancarnya operasional suatu perusahaan. Seperti keamanan di lingkungan tempat produksi atau pabrik, bisa mendukung proses produksi yang maksimal agar kualitas produk tetap terjaga bahkan bisa terus meningkat.<br><br>PT Sasa Inti dengan brandnya yang dikenal dengan nama \\u201cSasa\\u201d yang bergerak di produksi berbagai macam bahan masakan seperti santan, saus sambal, kaldu, vetsin dan masih banyak yang lainnya, belum lama ini melakukan kesepakatan kerjasama dengan POJ untuk mempercayakan pengamanan salah satu pabrik besarnya yang terletak di Minahasa Selatan, Sulawesi Utara kepada POJ.<br><br><br><\\/div>\",\"image_url\":\"banners\\/pHfRv6UUytLext4jeKStbit1cgScgmFpb9vit4Tx.png\",\"status\":\"publish\",\"user_id\":1,\"slug\":\"bank-ntb-syariah-percayakan-poj-untuk-sediakan-mobil-operasional\",\"updated_at\":\"2022-05-31T04:54:01.000000Z\",\"created_at\":\"2022-05-31T04:54:01.000000Z\",\"id\":4}'),(50,'966d8e85-1cb2-4ad6-8f9a-ca1ae8ffcd6e',1,'Update','App\\Models\\Article',4,'App\\Models\\Article',4,'App\\Models\\Article',4,'','finished','','2022-05-31 11:54:26','2022-05-31 11:54:26','{\"image_url\":\"banners\\/pHfRv6UUytLext4jeKStbit1cgScgmFpb9vit4Tx.png\"}','{\"image_url\":\"banners\\/gvrSETKBrzUBIW2wLyLf9SoyxByoDliebHwFNWiN.png\"}'),(51,'966d8f83-5309-49ee-9344-78d6f68facfd',1,'Create','App\\Models\\Article',5,'App\\Models\\Article',5,'App\\Models\\Article',5,'','finished','','2022-05-31 11:57:13','2022-05-31 11:57:13',NULL,'{\"title\":\"POJ DUKUNG OPERASIONAL DIREKSI PT PII (PERSERO)\",\"content\":\"<div>Sebagai perusahaan yang bergerak di bidang Jasa Penyewaan Mobil untuk perusahaan, PT Pesonna Optima Jasa (POJ) selalu siap mendukung kelancaran operasional perjalanan para clientnya. Hari ini, POJ mendapat kesempatan untuk bekerjasama dengan PT Penjaminan Infrastuktur Indonesia (Persero) (PT PII).<br><br>POJ mendapat kepercayaan untuk menyediakan kendaraan dinas untuk Direksi PT.PII berupa satu (1) unit mobil Toyota Camry Type 2.5 V A\\/T warna putih selama dua (2) tahun hingga Juli 2022 Terimakasih kepada PT.PII atas kepercayaannya kepada POJ. Semoga Kerjasama ini dapat berjalan lancar kedepannya.<br><br><\\/div><div><br><br><\\/div>\",\"image_url\":\"banners\\/D6tsh3xs65Tbbwk39k7vDte6uMBdegPHnVaQ6plW.jpg\",\"status\":\"publish\",\"user_id\":1,\"slug\":\"poj-dukung-operasional-direksi-pt-pii-persero\",\"updated_at\":\"2022-05-31T04:57:13.000000Z\",\"created_at\":\"2022-05-31T04:57:13.000000Z\",\"id\":5}'),(52,'966d904f-e0ab-4030-b299-801fa3e47d5d',1,'Create','App\\Models\\Article',6,'App\\Models\\Article',6,'App\\Models\\Article',6,'','finished','','2022-05-31 11:59:27','2022-05-31 11:59:27',NULL,'{\"title\":\"POJ Jalankan Program Corporate Social Responsibility (CSR) dengan Tema \\u2018POJ Peduli: Berbagi Hadapi Pandemi\\u2019\",\"content\":\"<div>&nbsp;Pada hari Jumat, 20 Agustus 2021 yang lalu, PT Pesonna Optima Jasa menjalankan kegiatan Corporate Social Responsibility atau CSR yang secara serempak dilaksanakan di sekitar kantor perwakilan PT POJ yang tersebar di 11 kota di Indonesia. Kegiatan CSR ini merupakan wujud implementasi dari bentuk kepedulian dan empati perusahaan terhadap kondisi masyarakat yang terdampak pandemi Covid-19.<br><br><\\/div><div>Kegiatan CSR dengan tema \\u2018POJ Peduli: Berbagi Hadapi Pandemi\\u2019 dilakukan dengan memberikan paket bantuan berisi sembako, masker dan uang tunai. Sasaran dari kegiatan ini adalah anak yatim, fakir miskin, dan masyarakat dengan penghasilan tidak tetap yang berada di sekitar kantor perwakilan POJ. Kegiatan ini berjalan dengan lancar dengan mematuhi protokol kesehatan yang berlaku serta tentunya berhasil dilaksanakan tanpa menimbulkan kerumunan.<br><br>Melalui kegiatan ini, diharapkan dapat sekaligus memperkenalkan layanan dan produk perusahaan kepada masyarakat di sekitar lingkungan unit kerja dengan kegiatan yang bermanfaat sehingga pada akhirnya pun dapat berdampak baik pula kepada nama perusahaan.<\\/div>\",\"image_url\":\"banners\\/t2sAlHCn191QPR2EY9p9NuZbZEKiEeGLyCrWFYoY.jpg\",\"status\":\"publish\",\"user_id\":1,\"slug\":\"poj-jalankan-program-corporate-social-responsibility-csr-dengan-tema-poj-peduli-berbagi-hadapi-pandemi\",\"updated_at\":\"2022-05-31T04:59:27.000000Z\",\"created_at\":\"2022-05-31T04:59:27.000000Z\",\"id\":6}'),(53,'966d91dc-3b41-45db-aca0-45367d9c3894',1,'Create','App\\Models\\Gallery',5,'App\\Models\\Gallery',5,'App\\Models\\Gallery',5,'','finished','','2022-05-31 12:03:47','2022-05-31 12:03:47',NULL,'{\"name\":\"Uji coba tag 1\",\"description\":\"Uji coba tag 1\",\"type\":\"image\",\"attachment\":\"JlJKiWVtojPqTtvTiNRb1FiWtIkoE6kS2RekTrvA.png\",\"attachment_name\":\"IMG_6599 1.png\",\"attachment_size\":149120,\"updated_at\":\"2022-05-31T05:03:47.000000Z\",\"created_at\":\"2022-05-31T05:03:47.000000Z\",\"id\":5}'),(54,'966d9229-c22c-405c-a3c5-8066a42c447b',1,'Create','App\\Models\\Gallery',6,'App\\Models\\Gallery',6,'App\\Models\\Gallery',6,'','finished','','2022-05-31 12:04:38','2022-05-31 12:04:38',NULL,'{\"name\":\"Testing foto 2\",\"description\":\"Testing foto 2\",\"type\":\"image\",\"attachment\":\"MvdSxnuHiCt4WGycCrZ7dNrZDKfSz8JMmReWrn97.png\",\"attachment_name\":\"IMG_6212 1.png\",\"attachment_size\":186404,\"updated_at\":\"2022-05-31T05:04:38.000000Z\",\"created_at\":\"2022-05-31T05:04:38.000000Z\",\"id\":6}'),(55,'966d926