ang terdapat di 11 kota di Indonesia yaitu Medan, Pekanbaru, Palembang, Jakarta, Bandung, Semarang, Surabaya, Denpasar, Balikpapan, Makassar, dan Manado.<\\/div><div><br><\\/div><div>Pada pelaksanaan CSR yang bertempat di kantor pusat PT POJ di Jakarta, acara dihadiri langsung oleh Direktur dan jajaran General Manager. Bapak Yul Afian, selaku Direktur PT POJ terjun langsung untuk menyambut serta membagikan paket sembako kepada warga sekitar bersama dengan karyawan PT POJ. Di kota-kota lainnya, selain membagikan sembako, beberapa kantor perwakilan POJ juga membagikan takjil kepada para pengendara yang melintas di sekitar lingkungan kantor. Tentunya, selama berjalannya proses acara seluruh karyawan PT POJ juga dilibatkan secara langsung.&nbsp;<\\/div><div><br><\\/div><div>Acara berjalan dengan lancar dan kondusif serta tetap mematuhi protokol kesehatan yang berlaku. Para penerima sembako telah didata sebelumnya melalui RT\\/RW\\/Tempat Ibadah dan kedatangannya dijadwalkan berdasarkan nomor kupon yang diterima.<\\/div><div><br><\\/div><div>Melalui kegiatan ini, diharapkan kehadiran PT Pesonna Optima Jasa dapat turut memberikan manfaat untuk lingkungan dan masyarakat sekitarnya.<\\/div><div><br><br><\\/div>\",\"image_url\":\"banners\\/MitXHGAInsbKb8oStwM57PmeYWjntCHO2gcZhisi.jpg\",\"status\":\"publish\",\"user_id\":1,\"slug\":\"pt-pesonna-optima-jasa-bagikan-ribuan-paket-sembako-ke-berbagai-kota-di-indonesia\",\"updated_at\":\"2022-06-21T08:03:25.000000Z\",\"created_at\":\"2022-06-21T08:03:25.000000Z\",\"id\":7}'),(385,'96981153-2843-4ed7-acac-a61271dfb32a',1,'Update','App\\Models\\Article',7,'App\\Models\\Article',7,'App\\Models\\Article',7,'','finished','','2022-06-21 15:04:58','2022-06-21 15:04:58','{\"content\":\"<div><strong>April 2022 <\\/strong>- Sepanjang bulan April 2022, PT Pesonna Optima Jasa menjalankan rangkaian acara <em>Corporate Social Responsibility<\\/em> yang mengambil tema \\u201cPOJ Peduli - Ramadhan Berbagi\\u201d dengan membagikan ribuan paket sem