INSERT INTO `articles` VALUES (1,1,'test','test','<div>asdasdasdasd</div><ul><li>asdasdasdasdasd</li><li>qweqweqweqwe</li><li>asdasdasdasd</li></ul><div><br></div><div><br></div>','banners/atlqAxuIjthrjU24G9mFLTSMNqOD9FEUjKfFc9Cg.jpg','draft','2022-05-16 07:33:48','2022-06-19 11:49:58'),(3,1,'POJ Siapkan Personil Security Terbaik Untuk Keamanan PT Sasa Inti Minahasa Selatan','poj-siapkan-personil-security-terbaik-untuk-keamanan-pt-sasa-inti-minahasa-selatan','<div>PT Pesonna Optima Jasa (POJ) telah dikenal sebagai salah satu perusahaan penyedia jasa keamanan terbaik dengan lebih dari 11 ribu personil security yang tersebar di seluruh Indonesia. Didukung dengan sistem keamanan SCC (Security Command Center), POJ terus berusaha memberi kontribusi nyata mendukung terwujudnya kebutuhan keamanan bagi para kliennya. Seperti yang diketahui, bahwa keamanan adalah salah satu faktor penting yang harus dipenuhi untuk mendukung lancarnya operasional suatu perusahaan. Seperti keamanan di lingkungan tempat produksi atau pabrik, bisa mendukung proses produksi yang maksimal agar kualitas produk tetap terjaga bahkan bisa terus meningkat.<br><br>PT Sasa Inti dengan brandnya yang dikenal dengan nama “Sasa” yang bergerak di produksi berbagai macam bahan masakan seperti santan, saus sambal, kaldu, vetsin dan masih banyak yang lainnya, belum lama ini melakukan kesepakatan kerjasama dengan POJ untuk mempercayakan pengamanan salah satu pabrik besarnya yang terletak di Minahasa Selatan, Sulawesi Utara kepada POJ.<br><br>POJ dipercaya PT Sasa Inti untuk mengamankan pabrik yang menjadi pusat produksi santan Sasa yang berlokasi di Kabupaten Minahasa Selatan, Sulawesi Utara dengan luas 82.274 m2 dan jumlah tenaga kerja didalamnya 800 orang. POJ mengerahkan 33 personil security terbaik yang sudah terseleksi dan terlatih, untuk mengamankan pabrik santan PT Sasa Inti di Kabupaten Minahasa Selatan. 33 Personil tersebut terdiri dari 1 Chief, 4 Komandan Regu (Danru) dan 28 Anggota. Secara khusus, kerjasama ini bertujuan untuk menjaga keamanan dan ketertiban antrian kelapa yang akan dijual ke PT Sasa Inti.</div><div><br><br></div><div><br></div>','banners/e0k8tEeXqd9drh91AhaLkOgsB0AR2kjj07l8NSuV.png','publish','2022-05-31 11:50:45','2022-05-31 11:52:39'),(4,1,'Bank NTB Syariah Percayakan POJ Untuk Sediakan Mobil Operasional','bank-ntb-syariah-percayakan-poj-untuk-sediakan-mobil-operasional','<div>PT Pesonna Optima Jasa (POJ) telah dikenal sebagai salah satu perusahaan penyedia jasa keamanan terbaik dengan lebih dari 11 ribu personil security yang tersebar di seluruh Indonesia. Didukung dengan sistem keamanan SCC (Security Command Center), POJ terus berusaha memberi kontribusi nyata mendukung terwujudnya kebutuhan keamanan bagi para kliennya. Seperti yang diketahui, bahwa keamanan adalah salah satu faktor penting yang harus dipenuhi untuk mendukung lancarnya operasional suatu perusahaan. Seperti keamanan di lingkungan tempat produksi atau pabrik, bisa mendukung proses produksi yang maksimal agar kualitas produk tetap terjaga bahkan bisa terus meningkat.<br><br>PT Sasa Inti dengan brandnya yang dikenal dengan nama “Sasa” yang bergerak di produksi berbagai macam bahan masakan seperti santan, saus sambal, kaldu, vetsin dan masih banyak yang lainnya, belum lama ini melakukan kesepakatan kerjasama dengan POJ untuk mempercayakan pengamanan salah satu pabrik besarnya yang terletak di Minahasa Selatan, Sulawesi Utara kepada POJ.<br><br><br></div>','banners/gvrSETKBrzUBIW2wLyLf9SoyxByoDliebHwFNWiN.png','publish','2022-05-31 11:54:01','2022-05-31 11:54:26'),(5,1,'POJ DUKUNG OPERASIONAL DIREKSI PT PII (PERSERO)','poj-dukung-operasional-direksi-pt-pii-persero','<div>Sebagai perusahaan yang bergerak di bidang Jasa Penyewaan Mobil untuk perusahaan, PT Pesonna Optima Jasa (POJ) selalu siap mendukung kelancaran operasional perjalanan para clientnya. Hari ini, POJ mendapat kesempatan untuk bekerjasama dengan PT Penjaminan Infrastuktur Indonesia (Persero) (PT PII).<br><br>POJ mendapat kepercayaan untuk menyediakan kendaraan dinas untuk Direksi PT.PII berupa satu (1) unit mobil Toyota Camry Type 2.5 V A/T warna putih selama dua (2) tahun hingga Juli 2022 Terimakasih kepada PT.PII atas kepercayaannya kepada POJ. Semoga Kerjasama ini dapat berjalan lancar kedepannya.<br><br></div><div><br><br></div>','banners/D6tsh3xs65Tbbwk39k7vDte6uMBdegPHnVaQ6plW.jpg','publish','2022-05-31 11:57:13','2022-05-31 11:57:13'),(6,1,'POJ Jalankan Program Corporate Social Responsibility (CSR) dengan Tema ‘POJ Peduli: Berbagi Hadapi Pandemi’','poj-jalankan-program-corporate-social-responsibility-csr-dengan-tema-poj-peduli-berbagi-hadapi-pandemi','<div>Pada hari Jumat, 20 Agustus 2021 yang lalu, PT Pesonna Optima Jasa menjalankan kegiatan Corporate Social Responsibility atau CSR yang secara serempak dilaksanakan di sekitar kantor perwakilan PT POJ yang tersebar di 11 kota di Indonesia. Kegiatan CSR ini merupakan wujud implementasi dari bentuk kepedulian dan empati perusahaan terhadap kondisi masyarakat yang terdampak pandemi Covid-19.<br><br>Kegiatan CSR dengan tema ‘POJ Peduli: Berbagi Hadapi Pandemi’ dilakukan dengan memberikan paket bantuan berisi sembako, masker dan uang tunai. Sasaran dari kegiatan ini adalah anak yatim, fakir miskin, dan masyarakat dengan penghasilan tidak tetap yang berada di sekitar kantor perwakilan POJ. Kegiatan ini berjalan dengan lancar dengan mematuhi protokol kesehatan yang berlaku serta tentunya berhasil dilaksanakan tanpa menimbulkan kerumunan.<br><br>Melalui kegiatan ini, diharapkan dapat sekaligus memperkenalkan layanan dan produk perusahaan kepada masyarakat di sekitar lingkungan unit kerja dengan kegiatan yang bermanfaat sehingga pada akhirnya pun dapat berdampak baik pula kepada nama perusahaan.<br><br>Di masa-masa ini, kepedulian terhadap sesama harus ditingkatkan, dan semoga bantuan sekecil apapun dapat berdampak besar kepada yang paling membutuhkan.<br><br>test</div>','banners/RrITQTa6pVsceCCRnWmolumqPNc7hw6yhbERLROp.png','publish','2022-05-31 11:59:27','2022-06-17 14:28:06'),(7,1,'PT Pesonna Optima Jasa Bagikan Ribuan Paket Sembako ke Berbagai Kota di Indonesia','pt-pesonna-optima-jasa-bagikan-ribuan-paket-sembako-ke-berbagai-kota-di-indonesia','<div>Sepanjang bulan April 2022, PT Pesonna Optima Jasa menjalankan rangkaian acara <em>Corporate Social Responsibility</em> yang mengambil tema “POJ Peduli - Ramadhan Berbagi” dengan membagikan ribuan paket sembako ke berbagai kota di Indonesia. Acara yang diadakan bertepatan dengan momentum bulan Ramadhan 1443 H ini bertujuan untuk menunjukan kepedulian perusahaan terhadap masyarakat yang kurang mampu secara ekonomi, yang berada di lingkungan sekitar kantor PT POJ. Paket sembako yang dibagikan berisi beras, gula, mie instan, dan berbagai bahan pangan lainnya serta uang tunai. Paket-paket ini dibagikan melalui kantor perwakilan POJ yang terdapat di 11 kota di Indonesia yaitu Medan, Pekanbaru, Palembang, Jakarta, Bandung, Semarang, Surabaya, Denpasar, Balikpapan, Makassar, dan Manado.</div><div><br></div><div>Pada pelaksanaan CSR yang bertempat di kantor pusat PT POJ di Jakarta, acara dihadiri langsung oleh Direktur dan jajaran General Manager. Bapak Yul Afian, selaku Direktur PT POJ terjun langsung untuk menyambut serta membagikan paket sembako kepada warga sekitar bersama dengan karyawan PT POJ. Di kota-kota lainnya, selain membagikan sembako, beberapa kantor perwakilan POJ juga membagikan takjil kepada para pengendara yang melintas di sekitar lingkungan kantor. Tentunya, selama berjalannya proses acara seluruh karyawan PT POJ juga dilibatkan secara langsung.&nbsp;</div><div><br></div><div>Acara berjalan dengan lancar dan kondusif serta tetap mematuhi protokol kesehatan yang berlaku. Para penerima sembako telah didata sebelumnya melalui RT/RW/Tempat Ibadah dan kedatangannya dijadwalkan berdasarkan nomor kupon yang diterima.</div><div><br></div><div>Melalui kegiatan ini, diharapkan kehadiran PT Pesonna Optima Jasa dapat turut memberikan manfaat untuk lingkungan dan masyarakat sekitarnya.</div><div><br><br></div>','banners/IpaCd8SrSULZe5hAIENGd269rNZ12Cex1pZweEhf.jpg','publish','2022-06-21 15:03:25','2022-06-24 10:51:04');
